import React, { useState, useEffect } from 'react';


const Data = () => {



    function fetchData() {
        fetch("https://s3-ap-southeast-1.amazonaws.com/he-public-data/studiod9c0baf.json").then(
            res => {
                return res.json();
            }
        ).then(
            data => {
                console.log(data.song);
                // setExpenses(data);
            }
        )
    }


    useEffect(() => {
        fetchData()
    }, []);





    return (
        <div>
            <h1>
                Home Page
            </h1>
        </div>
    )
}


export default Data;
